import React from "react";
import { FormGroup, FormControlLabel, Checkbox, FormLabel } from "@material-ui/core";


const CheckBoxInfo = () => {
    return (
        <FormGroup row>
        <FormLabel>When did you run?</FormLabel>
          <FormControlLabel control={<Checkbox name="hs" />} label="High School" />
          <FormControlLabel control={<Checkbox name="col" />} label="College" />
        </FormGroup>
      );
}

export default CheckBoxInfo;
